import React from 'react';
import QuoteItem from './QuoteItem';

const Quotes = (quotes, count) => {
  return (
    <div className={quoteStyle}>
      {quotes.map(quote => (
        <QuoteItem key={quotes.quote_id} quote={quote} />
      ))}
    </div>
  );
};

const quoteStyle = {
  display: 'flexbox',
  flexDirection: 'column'
};

export default Quotes;
